            <img src={` https://spoonacular.com/recipeImages/${meal.id}-480x360.jpg`} alt={meal.title} />
            <h3>{meal.title}</h3>
            <p>Calories: { nutrients.calories }</p>
            <p>Carbohydrates: {nutrients.carbohydrates}</p>
